import React from "react";

const PublicFooter = () => {
  const content = (
    <footer className="dash-footer">
      <p style={{ textDecoration: "underline" }}>
        <Link to="/login">Employee Login</Link>
      </p>
    </footer>
  );
  return <div>PublicFooter</div>;
};

export default PublicFooter;
